import React from 'react'

const Image = ({ baseClase, images, alt }) => (
    <img
        className={ `${baseClase}__image` }
        srcSet={ `
            ${images.imageS} 768w,
            ${images.imageM} 1200w,
            ${images.imageL} 1440w,
        ` }
        sizes="(max-width: 768px) 700px,
            (max-width: 1200px) 1000px,
            1440px"
        src={ images.imageL }
        alt={ alt }
    />
);

export default Image;
